INSERT INTO `script_texts` VALUES (-1720264,'FOR KALIMDOR!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,0,NULL),(-1720263,'I am with you until I gasp my last dying breath.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,0,NULL),(-1720262,'I am Saurfang. Brother of Broxigar. You know me to be the Supreme Commander of the Might of Kalimdor. An orc - a true orc warrior - wishes for one thing: To die in the glory of battle against a hated enemy. Some of you have fought in battles. Peace has been with us for many years. Many years we sat idle but many years we battled. In those years - where strife, the land and Legion and Scourge, sacked our homes, killed our families  these insects dwelled beneath us. Beneath our homes  waiting. Waiting to crush the life from our little ones. To slay all in their path. This they do for their god. And for our gods? We defend. We stand. We show that as one. United. We destroy. Their god will fall. To die today, on this field of battle, is to die an orcish death. To die today is to die for our little ones. Our old ones. Our  loved ones. Would any of you deny yourselves such a death? Such an honor?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,0,NULL),(-1720261,'FOR HONOR!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,NULL),(-1720260,'FER MAGNI!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,NULL),(-1720259,'An amazing discovery you have made. I would love an opportunity to look at all of the failed experiments.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 6'),(-1720258,'A little ritual torture can go a long way.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 6'),(-1720257,'I donÂ’t approve of your experiments, Gerard, but I must admit the results are impressive. What exactly did you do to her?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,6,'UC RP - 6'),(-1720256,'How do you like my pet?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 6'),(-1720255,'Did you have to house train her, Gerard?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 5'),(-1720254,'A little torture, a pinch of magic, and an ample helping of invasive surgery. She was conscious, of course.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 5'),(-1720253,'Amazing! How did you manage a permanent dominate?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,6,'UC RP - 5'),(-1720252,'As good as I told you it would be, yes?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 5'),(-1720251,'Bravo, Gerard, you have exceeded yourself yet again.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,4,'UC RP - 4'),(-1720250,'You donÂ’t expect me to give up all of my secrets, do you?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 4'),(-1720249,'She retains knowledge and speech, and even the self sufficiency to perform tasks for you. Precisely what did you do?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,6,'UC RP - 4'),(-1720248,'How do you like my pet?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 4'),(-1720247,'I donÂ’t agree with your turning to alchemy to fix some of the problems, but I do agree with the results. Very well done.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 3'),(-1720246,'I managed to discover that certain parts of the brain when removed or stimulated will make the subject much more docile.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 3'),(-1720245,'Truly amazing, Gerard. How did you do it?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,6,'UC RP - 3'),(-1720244,'So what do you think of my new toy?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 3'),(-1720243,'I donÂ’t agree with your turning to alchemy to fix some of the problems, but I do agree with the results. Very well done.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 2'),(-1720242,'Everyone has a weakness, itÂ’s just a matter of finding it.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 2'),(-1720241,'IÂ’ve never seen anything like it. No concentration or loss of awareness while the subject is dominated. What did you do to her?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,6,'UC RP - 2'),(-1720240,'DidnÂ’t I tell you my new domination techniques would work?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 2'),(-1720239,'I am truly impressed, Gerard. I thought you were all talk, but I see I have been proven wrong.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,4,'UC RP - 1'),(-1720238,'It was simple once I broke her spirit.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 1'),(-1720237,'Truly amazing, Gerard. How did you do it?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,6,'UC RP - 1'),(-1720236,'DidnÂ’t I tell you my new domination techniques would work?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,33,1,'UC RP - 1'),(-1720235,'Here you are, $N.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,7,0,'Jordan Stilwell - Say 2'),(-1720234,'Let\'s get to work, $N.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,7,0,'Jordan Stilwell - Say 1'),(-1720233,'Wha... what\'s happening?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,15,'Thersa Windsong - Say'),(-1720232,'There! Job\'s done.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,1,'Chemist Cuely - Say'),(-1720219,'I can\'t believe it! You\'ve destroyed my pack... Now face my wrath!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,0,'Wolf Master Nandos - Yell Pack'),(-1720218,'Blood and souls for Hakkar! HAHAHAH!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,0,'Yeh\'kinya - Say 2'),(-1720217,'It is true, $N. The wheels of doom now turn, inevitably, toward the true return of Hakkar!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Yeh\'kinya - Say 1'),(-1720216,'The King\'s guards should be along shortly to pick up the Memorial. In the mean time, come join me upstairs and let\'s finish our little chat, $N.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,7,1,'Marblesten - Say 3'),(-1720215,'There you have it! The King should be quite pleased, if I do say so myself.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,7,1,'Marblesten - Say 2'),(-1720214,'I\'ll get to work right away, $N!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,7,5,'Marblesten - Say 1'),(-1720213,'Looks like Skarr has found his next challenger! Wouldn\'t want to be in that poor fool\'s shoes!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,5,'Griniblix - Skarr Aggro Yell'),(-1720212,'It\'s time for the main event! Skarr the Unbreakable is in the maul!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,22,'Griniblix - Skarr Spawn Yell'),(-1720211,'Woohoo! They are into it now!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,5,'Griniblix - The Razza Aggro Yell'),(-1720210,'Can that be the Razza down there in the Maul? This is going to be exciting!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,22,'Griniblix - The Razza Spawn Yell'),(-1720209,'This will teach you to lay off the herb, $N.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,'Mushgog - Say Kill'),(-1720208,'My power is discombobulatingly devastating! It is ludicrous that these mortals even attempt to enter my realm!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,0,'Prince Thunderaan - Yell'),(-1720207,'Bye! Better luck next time!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,3,'Hornizz Brimbuzzle - Say 1'),(-1720206,'Well, I\'m off to the Gelkis. They\'re not as dumb as the Maraudines, but they\'re more reasonable.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,3,'Melizza Brimbuzzle - Say 5'),(-1720205,'We\'re going to have to scratch the Maraudines off our list. Too hard to work with...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Melizza Brimbuzzle - Say 4'),(-1720204,'Hey Hornizz! I\'m back! And there are some people behind me who helped me out of a jam.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,5,'Melizza Brimbuzzle - Say 3'),(-1720203,'We made it! Thanks again! I\'m going to run ahead!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,'Melizza Brimbuzzle - Say 2'),(-1720202,'Thanks $N. Now let\'s get out of here!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Melizza Brimbuzzle - Say 1'),(-1720201,'You must not summon our god!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,0,'Nightmare Suppressor - Yell 2'),(-1720200,'No! You must not do this!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,0,'Nightmare Suppressor - Yell 1'),(-1720199,'DIE, MORTALS!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5871,1,0,0,'Avatar of Hakkar - Yell Aggro'),(-1720198,'I AM HERE!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,0,0,'Avatar of Hakkar - Yell Spawn'),(-1720197,'I TASTE THE BLOOD OF LIFE!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5868,1,0,0,'Shade of Hakkar - Yell 4'),(-1720196,'I DRAW CLOSER TO THIS WORLD!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5867,1,0,0,'Shade of Hakkar - Yell 3'),(-1720195,'I AM NEAR!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5869,1,0,0,'Shade of Hakkar - Yell 2'),(-1720194,'HAKKAR LIVES!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5870,1,0,0,'Shade of Hakkar - Yell 1'),(-1720193,'You are an agent of their wicked god, fool. I will see you destroyed!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,4,0,0,'Eranikus the Chained - whisper 8'),(-1720192,'Foolish mortal, I will rend your soul in two once I am released!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,4,0,0,'Eranikus the Chained - whisper 7'),(-1720191,'My soul is not a trinket! Mortal, you must release me from these chains!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,4,0,0,'Eranikus the Chained - whisper 6'),(-1720190,'My charge to watch the temple has failed... my corrupted soul knows no peace...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,4,0,0,'Eranikus the Chained - whisper 5'),(-1720189,'Foolish mortal, I will rend your soul in two once I am released!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,4,0,0,'Eranikus the Chained - whisper 4'),(-1720188,'My eyes! It burns... it burns...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,4,0,0,'Eranikus the Chained - whisp