ains much.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 19'),(-1720105,'The war continued but the will of the great leader was sapped. The whole of Silithus was soon engulfed by the silithid and their Qiraji hosts.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 18'),(-1720104,'Valstann, eager to please his father, convinced Fandral to allow him to take a small battalion to the defense of Southwind. Surely with the tide of battle turning their way, no harm could come to his beloved child. The trap was missed. Valstann was captured by the hiding Qiraji and Southwind Village obliterated. Rajaxx himself would take the captive Valstann to the front lines of the battle where - in front of Staghelm and the night elf forces - he would brutally execute the young night elf.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 17'),(-1720103,'The Qiraji forces were commanded to fall back and hide the bulk of their numbers beneath the sands of the desert. A small attack was ordered upon Southwind Village while the front lines of Staghelm\'s army were kept occupied.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 16'),(-1720102,'Valstann Staghelm served as the right hand of Fandral. A proud and noble warrior, his dedication and adoration for his father unyielding... and the Twin Emperors sensed this as weakness. A weakness that could be exploited.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 15'),(-1720101,'Vek\'nilash and Vek\'lor, known as the Twin Emperors of Ahn\'Qiraj, watched the war from the sanctuary of their temple. The clever brothers devised a plan to demoralize and divide Staghelm\'s forces.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 14'),(-1720100,'Unfortunately, the night elf defense was untenable and Rajaxx knew that they could not hold out much longer. Their tenacity, however, was causing great frustration to Rajaxx and causing even more frustration to his king. Wait, kings? Incredible...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 13'),(-1720099,'Staghelm and his armies were clearly overwhelmed as the endless flow of Rajaxx\'s troops poured into Silithus. It would seem as if Staghelm, however, was more than just a nuisance to the Qiraji. Under Staghelm, the whole of the night elf armies had come together to defend Kalimdor, greatly slowing the Qiraji forces.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 12'),(-1720098,'A mighty Qiraji known as General Rajaxx would command the initial incursion into Silithus. Only one would stand in his way: A night elf known as Staghelm. They refer to him as Khar\'sis or \'hand of the earth\' in the native Qiraji tongue.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 11'),(-1720097,'The Titans had long since vacated this world. Only the night elves that once inhabited this area were here to defend. Oh my! The next passage is fascinating!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,5,'Geologist Larksbane - say 10'),(-1720096,'The moment that C\'Thun had so patiently waited for had finally arrived. His children had spent thousands of years building an army capable of exacting revenge upon the whole of Kalimdor and now the prize was within their grasp.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 9'),(-1720095,'There is more.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 8'),(-1720094,'This can\'t be right. An Old God could never be allowed to enter this world. The results would be... Oh dear!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,5,'Geologist Larksbane - say 7'),(-1720093,'The Old God would create avatars from the silithid in its own image. These avatars were to be known as Qiraji. Sentient and with purpose, the Qiraji would name their creator: C\'Thun was born... For many thousands of years the Qiraji worked feverishly to build a force capable of laying waste to the world that would betray their god. The great fortress city of Ahn\'Qiraj was created to house their growing armies and prepare for the coming of C\'Thun.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 6'),(-1720092,'The land of eternal starlight, Kalimdor, was a nurturing mother to all of its creatures. The magic of the Well of Eternity permeated the land and empowered the multitude of flora and fauna that would make the world their home. From this magical ether were born the silithid. It was throught the silithid that the brooding Old God would reach and attempt to sunder the world that it once held in its unmerciful grasp.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 5'),(-1720091,'For millennia this being lay dormant beneath the world - biding its time. From its prison it waited for the exact moment at which to strike back at those that would see it harmed.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 4'),(-1720090,'In the time before time, when the world was still in its infancy, a battle between a Titan and a being of unimaginable evil and power raged on this very soil. The prophecy is unclear about whether or not the Titan was vanquished in this battle but it illustrates that a Titan fell. An Old God had also fallen - or so it was thought.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 3'),(-1720089,'It is history.. A history of Silithus... of Ahn\'Qiraj... of Titans and Old Gods... I read from the prophecy of C\'Thun as written by the Qiraji Prophet Skeram. A prophecy that portends a cataclysm...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 2'),(-1720088,'I will do my best to translate and describe what I see.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,'Geologist Larksbane - say 1'),(-1720087,'Th